  return (
    <div className='app'>
      <div className='container'>
      <img src={ image } width="200px"  alt="grocery"/>
      </div>
      <div className='container'>
      <h1>Grocery List</h1>
      </div>
      <GroceryList/>
      <div className='conta'>
      <img src={ imageTwo } width="250px"  alt="man"/>
      </div>
    </div>
  );
}

export default App;
